       var aws=d.createElement('script');
       aws.type='text/javascript';
       aws.async=true;
       aws.src='https://wix.wixanswers.com/apps/widget/v1/wix/3863877f-d5aa-4b5a-bdaa-357add14f43f/' + ((window.__INITIAL_I18N__ && window.__INITIAL_I18N__.locale) || 'en') + '/embed.js';

